#import "USLocation.h"



@implementation USLocation

static NSArray *zipcode;
static NSArray *city;

+ (NSString*) infofromcity:(NSString*)wantcity {
    NSInteger index = [city indexOfObject:wantcity];
    NSString *finalstring = [NSString stringWithFormat:@"%@", [zipcode objectAtIndex:index]];
    return finalstring;
}

+ (NSString*) infofromzipcode:(NSString *)wantzipcode {
    NSInteger index = [zipcode indexOfObject:wantzipcode];
    NSString *finalstring = [NSString stringWithFormat:@"%@", [city objectAtIndex:index]];
    return finalstring;
}

+ (NSString*) getcitydata:(NSString*)city1 {
    NSLog(@"sending in%@", city1);
    return [NSString stringWithFormat:@"%@", [city objectAtIndex:[city indexOfObject:city1]]];
}

+ (NSArray*) zipcode {
    return zipcode;
}

+ (NSArray*) city {
    return city;
}


































